import React from 'react';
import FormComponent from '../../components/FormComponent3';

// Subject data array
const subjectsData = [
  {
    name: "Anatomy",
    theoryMax: 150,
    theoryMin: 75,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 200,
    totalMin: 100,
    result: ''
  },
  {
    name: "Physiology",
    theoryMax: 150,
    theoryMin: 75,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 200,
    totalMin: 100,
    result: ''
  },
  {
    name: "Biochemistry",
    theoryMax: 100,
    theoryMin: 50,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 150,
    totalMin: 75,
    result: ''
  }
];

// Functional component to render the form
const BPT2Semester = () => {
  return (
    <FormComponentBPT
      title="2 semester Year MBBS - Marks Memo"
      subjectsData={subjectsData}
    />
  );
};

export default BPT2Semester;
